    // MÃ©todos auxiliares
    public static File crearArchivo(String path, String fileName) {

        // AÃ±adir extensiÃ³n al nombre
        fileName += ".txt";

        // Concatenar ruta con nombre del archivo
        path += fileName;

        // Instanciar objeto File
        f = new File(path);

        return f;
    }

    public static File crearArchivo(String path, String fileName, boolean bin) {
        
        // AÃ±adir extensiÃ³n al nombre dependiendo si serÃ¡ archivo binario o de texto
        if (bin) {
            fileName += ".bin";
        } else {
            fileName += ".txt";
        }

        // Concatenar ruta con nombre del archivo
        path += fileName;

        // Instanciar objeto File
        f = new File(path);

        return f;
    }

    // MÃ©todos de lectura y escritura en texto plano
    public static void escribirFichero(File fichero) {

        f = fichero;

        // InstanciaciÃ³n del array personas que puede contener varios objetos Persona
        // En este caso solo vamos a almacenar 3 personas en el array
        personas = new Persona[3];

        if (f.exists()) {
            System.out.println("\nYa existe un fichero con ese nombre.");
            System.out.println("PodrÃ¡ sobrescribirlo o aÃ±adir los datos");
            System.out.println("a la informaciÃ³n existente");
        }

        for (int i = 0; i < personas.length; i++) { // Bucle for, para realizar la solicitud de datos 3 veces

            // InstanciaciÃ³n del objeto persona
            p = new Persona();

            // Solicita al usuario los datos de la persona
            System.out.println("\nA continuaciÃ³n, indique los datos de la persona nÂº" + (i + 1));

            System.out.println("\nIntroduzca el nombre:");
            p.setNombre(scanner.nextLine());

            System.out.println("\nIntroduzca el apellido:");
            p.setApellido(scanner.nextLine());

            System.out.println("\nIntroduzca la ciudad de nacimiento:");
            p.setCiudad(scanner.nextLine());

            System.out.println("\nIntroduzca la nacionalidad:");
            p.setNacionalidad(scanner.nextLine());

            System.out.println("\nIntroduzca la edad en aÃ±os:"); // *** En el enunciado no se pide validar que el dato introducido sea un nÃºmero, asumimos que el usuario siempre introducirÃ¡ numeros
            p.setEdad(scanner.nextInt());
            scanner.nextLine(); // Para escapar el Ãºltimo intro del nextInt anterior

            personas[i] = p;

        }

        try {
            if (f.exists()) { // Si el archivo existe, preguntar al usuario si desea sobreescribirlo o aÃ±adir los datos
                System.out.println("\nYa existe un fichero con ese nombre.");
