int QuickSelect(vector<int> med) {
  constexpr int kInfin = 2e9;
  while (med.size() % 5 != 0) {
    med.push_back(kInfin);
  }
  if (sh) {
    cout << "QuickSelect\n";
    cout << "med\n";
    for (int ii : med) {
      cout << ii << ' ';
    }
    cout << "\n";
  }

  vector<int> new_med;
  for (int ii = 0; ii < (int)med.size(); ii += 5) {
    vector<int> vv = {med[ii], med[ii + 1], med[ii + 2], med[ii + 3],
                      med[ii + 4]};
    int kk = GetMed(vv);
    new_med.push_back(kk);
  }
  if (new_med.size() == 1) {
    return new_med[0];
  }
  if (new_med.size() == 2) {
    if (new_med[0] != kInfin) {
      return new_med[0];
    }
    return new_med[1];
  }
  if (new_med.size() <= 5) {
    for (int ii : new_med) {
      if (ii != kInfin) {
        return ii;
      }
    }
    return new_med[2];
  }
  if (sh) {
    cout << "new_med\n";
    for (int ii : new_med) {
      cout << ii << ' ';
    }
    cout << "\n\n";
  }
  new_med = DQS(new_med);
  int res = QuickSelect(new_med);
  if (sh) {
    cout << "QuickSelect res = " << res << "\n\n";
  }
  return res;
}

vector<int> DQS(vector<int> aa) {
  if (aa.size() == 1) {
    return aa;
  }
  if (aa.size() == 2) {
    return {min(aa[0], aa[1]), max(aa[0], aa[1])};
  }
  int piv = QuickSelect(aa);
  aa = Partition(aa, piv);
  if (sh) {
    cout << "PERTITION DONE\n";
    cout << "piv = " << piv << "\n";
    cout << "aa\n";
    for (int ii : aa) {
      cout << ii << ' ';
    }
    cout << "\n\n";
  }
  vector<int> bb;  //<piv
  vector<int> cc;  //==piv
  vector<int> dd;  //>piv
  for (int ii : aa) {
    if (ii < piv) {
      bb.push_back(ii);
    } else if (ii == piv) {
      cc.push_back(ii);
    } else {
      dd.push_back(ii);
    }
  }
  if (!bb.empty()) {
    bb = DQS(bb);
  }
  if (!dd.empty()) {
    dd = DQS(dd);
  }
  vector<int> res;
  for (int ii : bb) {
    res.push_back(ii);
  }
  for (int ii : cc) {
    res.push_back(ii);
  }
  for (int ii : dd) {
    res.push_back(ii);
  }
  return res;
  if (sh) {
    cout << "res\n";
    for (int ii : res) {
      cout << ii << ' ';
    }
    cout << "\n";
  }
}

