using std::vector;

bool sh = 1;

void swap(int* p1, int* p2) {
  int t = *p1;
  *p1 = *p2;
  *p2 = t;
}


vector<int> Partition(vector<int> aa, int xx) {
  //Ð´ÐµÐ»Ð¸Ð¼ Ð½Ð° < Ð¸ >=
  int nn = aa.size();
  int ll = -1;
  for (int ii = 0; ii < nn; ++ii) {
    if (aa[ii] < xx) {
      int* p1 = &aa[ii];
      int* p2 = &aa[ll + 1];
      swap(p1, p2);
      ll++;
    }
  }
  //Ð´ÐµÐ»Ð¸Ð¼ Ð½Ð° = Ð¸ >
  for (int ii = ll + 1; ii < nn; ++ii) {
    if (aa[ii] == xx) {
      int* p1 = &aa[ii];
      int* p2 = &aa[ll + 1];
      swap(p1, p2);
      ll++;
    }
  }
  return aa;
}

int get_med(vector<int> vv) {
  for (int ii = 0; ii < 5; ++ii) {
    for (int jj = 0; jj < 4; ++jj) {
      if (vv[jj] > vv[jj + 1]) {
        int* p1 = &vv[jj];
        int* p2 = &vv[jj + 1];
        swap(p1, p2);
      }
    }
  }
  return vv[2];
}

int inf = 2e9;

vector<int> DQS(vector<int> aa);

int QuickSelect(vector<int> med) {
  while (med.size() % 5 != 0) {
    med.push_back(inf);
  }
  vector<int> new_med;
  for (int ii = 0; ii < med.size(); ii += 5) {
    vector<int> vv = {med[ii], med[ii + 1], med[ii + 2], med[ii + 3], med[ii + 4]};
    new_med.push_back(vv[2]);
  }
  if (new_med.size() == 1) {
    return new_med[0];
  }
  new_med = DQS(new_med);
  int res = QuickSelect(new_med);
  return res;
}

vector<int> DQS(vector <int> aa) {
    if (sh) {
      cout << "DQS\n";
      cout << "aa\n";
      for (int ii: aa) {
        cout << ii << ' ';
      }
      cout << "\n";
    }
    int piv = QuickSelect(aa);
    aa = Partition(aa, piv);
    if (sh) {
      cout << "piv = " << piv << "\n";
      cout << "aa\n";
      for (int ii: aa) {
        cout << ii << ' ';
      }
      cout << "\n";
    }
    vector<int> bb; //<piv
    vector<int> cc; //==piv
    vector<int> dd; //>piv
    for (int ii: aa) {
      if (ii < piv) {
        bb.push_back(ii);
      } else if (ii == piv) {
        cc.push_back(ii);
      } else {
        dd.push_back(ii);
      }
    }
    bb = DQS(bb);
    dd = DQS(dd);
    vector<int> res;
    for (int ii: bb) {
      res.push_back(ii);
    }
    for (int ii: cc) {
      res.push_back(ii);
    }
    for (int ii: dd) {
      res.push_back(ii);
    }
    return res;
    if (sh) {
      cout << "res\n";
      for (int ii: res) {
        cout << ii << ' ';
      }
      cout << "\n";
    }
}





